function eliminarApp(){const o=$("#id_aplicar_delete_modal").attr("data-app");$.ajax({url:urls.delete,type:"POST",data:{app:o},success:function(o){"True"===o.Exito?location.reload(!0):console.log("Error")},error:function(o,a,e){console.log(a,e)}})}function cancelarApp(){const o=$("#id_aplicar_cancel_modal").attr("data-app");$.ajax({url:urls.cancel,type:"POST",data:{app:o},success:function(o){"True"===o.Exito?location.reload(!0):console.log("Error")},error:function(o,a,e){console.log(a,e)}})}$(document).ready(()=>{$("#id_buscar").on("keyup",()=>{$(".course-name").map((o,a)=>{const e=$("#id_buscar").val().toString().toLowerCase();$(a).html().toString().toLowerCase().indexOf(e)>-1?$(a).parent().show():$(a).parent().hide()})})});